import "./Card.css";
const Card = () => {
  return (
    <div>
      <h2>A lifetime of discounts? It's Genius</h2>
      <p>
        Get rewarded for your travels-unlock instant savings of 10% or more with
        a free account
      </p>
      <button>Sign in/</button>
    </div>
  );
};
export default Card;
